import React from 'react';
import ReactDom from 'react-dom';

ReactDom.render( 
<React.Fragment>
  <h1> Talha Bajwa </h1>,
  <p>I am a developer</p>,
  <h2>Hey Umair</h2>
  </React.Fragment>, 
   document.getElementById("root"));
